   handleClick=(e)=>{
      e.stopPropogation();
      console.log('this is click')
   }
   render() {
       return (
           <div onClick={this.handleClick}className="film-row-fave add_to_queue">
                <p className="material-icons">add_to_queue</p>
           </div>
       )
   }
}

export default Fave;
